import BaseContainer from '../BaseContainer'
import React from  'react'
import PixelUtil from '../../tools/PixelUtil'
import './main.less'
import { List } from 'antd-mobile';
import {GENERAL} from '../../const/locations'
import getStorage from '../../tools/Storage';

const styles ={
    statusBar:{
        height:PixelUtil.getStatusBarHeight(),
        width:'100vw',
        backgroundColor:'#fff',
    },
    items:{
        width:'100vw',
        height:'13vw',
        backgroundColor:'#fff',
        margin:'3vw auto'
    },
}


const icons = [
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,"
]
const Item = List.Item;
const BUTTONS = ['账号与安全','隐私','通用','关于UniPolar','检查更新','帮助与反馈']

class Settings extends BaseContainer{
    constructor(props){
        super(props)
        this.state={};
        this.username=''
    }

    componentWillMount(){
        const uerN = getStorage.getItem('name')
        if(uerN==='null'){
             return;
        }
        this.username = uerN;
    }

    render(){
        return (<div>
            <div style={styles.statusBar}/>
            <List>
                <Item
                 thumb={icons[0]}
                 arrow="horizontal"
                 onClick={() => {console.log(window.navigator.userAgent)}}
                >{BUTTONS[0]}</Item>
                 <Item
                 thumb={icons[1]}
                 arrow="horizontal"
                 onClick={() => {this.toast(BUTTONS[1])}}
                >{BUTTONS[1]}</Item>
                 <Item
                 thumb={icons[2]}
                 arrow="horizontal"
                 onClick={() => {this.navigate(GENERAL,'General')}}
                >{BUTTONS[2]}</Item>
                 <Item
                 thumb={icons[3]}
                 arrow="horizontal"
                 onClick={() => {this.toast(BUTTONS[3])}}
                >{BUTTONS[3]}</Item>
                 <Item
                 thumb={icons[4]}
                 arrow="horizontal"
                 onClick={() => {this.toast('已经是最新版本')}}
                >{BUTTONS[4]}</Item>
                 <Item
                 thumb={icons[5]}
                 arrow="horizontal"
                 onClick={() => {this.toast(BUTTONS[5])}}
                >{BUTTONS[5]}</Item>
            </List>


            <div 
                onPointerDown={() => {
                    const sty = this.block.className
                    this.block.className = sty==='test-a'?'test-b':'test-a'
                    this.block.innerHTML = sty==='test-a'?'退出登录':'登录'
                }} 
                className='test-a' 
                ref = {el => this.block = el}>
                    登录
                </div>
        </div>)
    }
    
}
export default Settings;